import React from 'react';
import titulo from './gfx/title';
import "./screen.css";

function Academia() {
    return (
        <React.Fragment>
            <div class="academia">
                <div class="circulo"/>
                <div class="livro">
                    <img id="title" src="./gfx/title.png"/>
                    <a class="botaoHome" href="login.html">Entrar</a>
                    <a class="botaoHome" href="signin.html">Criar Conta</a>
                </div>
            </div>
        </React.Fragment>
    );
}

export default Academia;
